      // 	if(res.code==0){
      // 		that.modalName='DialogModal'
      // 	}
      // })
      //获取定义流程列表，
      var budding = getApp().globalData.BaseBudding;
      // let project = getApp().globalData.projectItem;
      console.log("查看缓存");
      console.log(getApp().globalData);
      uni.request({
        url: _home.default.GetProcessDefinition,
        method: 'GET',
        data: {
          tenantIdIn: budding.id },

        success: function success(vlaue) {
          //console.log('流程');
          //console.log(vlaue);

          if (vlaue.statusCode == 200) {
            var res = vlaue.data;
            var id;
            var enId;
            for (var i = 0; i < res.length; i++) {
              if (res[i].key == 'broker') {
                id = res[i].id;
              }
              if (res[i].key == 'enrecommend') {
                enId = res[i].id;
              }
            }

            if (that.flags) {
              if (id) {
                that.PostProcess(id);
              } else {
                uni.showToast({
                  title: "请检查key为broker的流程是否存在",
                  icon: "none",
                  duration: 3000 });

              }
            } else {
              if (enId) {
                console.log(enId);
                that.PostProcess(enId);
              } else {
                uni.showToast({
                  title: "请检查key为enrecommend的流程是否存在",
                  icon: "none",
                  duration: 3000 });

              }
            }


          } else {
            uni.showToast({
              title: '未找到有效流程，或流程未配置',
              icon: 'none',
              duration: 3000 });

          }
        } });

